import React from "react";
function RightImg({imageURL,producName,productDesc,learnMore}) {
  return (
     <div className="container mt-5 mb-5">
      <div className="row mt-5">
         <div className="col-6 p-5 ">
          <h2 className="mb-4">{producName}</h2>
          <p className="mb-4">{productDesc}</p>
          <div style={{textDecoration:"none"}} className="mb-4">
          <a href={learnMore}style={{marginLeft:"70px", textDecoration:"none"}} className="fs-6">{learnMore}</a>
          </div>
        </div>
        <div className="col-6 p-5">
          <img src={imageURL} alt={producName} className="img-fluid" />
        </div>
       
      </div>
    </div>
  );
}
export default RightImg;
